import React from "react";
import styles from "./City.module.css";

export default function City({ city }) {
  return (
    <div className={styles.container}>
      <h2>{city.name}</h2>
      <div>
        <div className={styles.infoText}>Temperatura: {city.max} ยบC</div>
        <div className={styles.infoText}>Clima: {city.weather}</div>
        <div className={styles.infoText}>Viento: {city.wind} km/h</div>
        <div className={styles.infoText}>Cantidad de nubes: {city.clouds}</div>
        <div className={styles.infoText}>Latitud: {city.latitud}ยบ</div>
        <div className={styles.infoText}>Longitud: {city.longitud}ยบ</div>
      </div>
    </div>
  );
}
